import React from 'react'

const Contactgeo = () => {
  return (
    <div className="col-sm  mx-2 ">
      <iframe
        width="100%"
        height="100%"
        title="map"
        className="card mt-2 mb-2 mh-100"
        style={{ height: '500px' }}
        src="https://maps.google.com/maps?q=ben%20arous%20nassen%20&t=k&z=13&ie=UTF8&iwloc=&output=embed"
      />
    </div>
  )
}

export default Contactgeo
